import React from "react";

// core components
import AthleteNavbar from "components/Navbars/AthleteNavbar.js";
import AthleteLandingPageHeader from "components/GymViews/GymLandingPageHeader.js";

function AthleteLandingPage() {
  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("profile-page");
    return function cleanup() {
      document.body.classList.remove("profile-page");
    };
  });
  return (
    <>
      <AthleteNavbar />
      <AthleteLandingPageHeader />
    </>
  );
}

export default AthleteLandingPage;
